/****** Object:  StoredProcedure [dbo].[buscar_profesor]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[buscar_profesor]
    @Texto VARCHAR(100)
AS
BEGIN
    SET NOCOUNT ON;

    SELECT TOP 50
        P.Id_Profesor,
        (U.Nombres + ' ' + U.ApPaterno + ', ' + U.ApMaterno) AS NombreCompleto
    FROM Profesor P
    JOIN Usuario U ON P.Id_Profesor = U.Id
    WHERE U.Activo = 1
      AND (
            U.Nombres + ' ' + U.ApPaterno + ' ' + U.ApMaterno LIKE '%' + @Texto + '%'
          )
    ORDER BY NombreCompleto;
END;
GO
