CREATE   PROC [dbo].[buscar_salon_nombre]
    @Texto VARCHAR(100)
AS
BEGIN
    SET NOCOUNT ON;

    SELECT TOP 50
        s.Id_Salon,
        s.Nombre
    FROM Salon s
    WHERE 
        (@Texto IS NULL OR @Texto = '' OR s.Nombre LIKE '%' + @Texto + '%')
    ORDER BY s.Nombre;
END;
GO
