GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[insertar_alumnos]
(
    @Id_TipoDocumento INT,
    @Id_Apoderado INT,
    @Nombres VARCHAR(50) = NULL,
    @ApPaterno VARCHAR(50) = NULL,
    @ApMaterno VARCHAR(50) = NULL,
    @Documento VARCHAR(20),
    @FechaNacimiento DATE = NULL,
    @Sexo CHAR(1) = NULL,

    @FoNombre VARCHAR(255) = NULL,
    @FoTamanioBytes BIGINT = NULL,
    @Fotos VARBINARY(MAX) = NULL,

    @CDNombre VARCHAR(255) = NULL,
    @CDTamanioBytes BIGINT = NULL,
    @CopiaDni VARBINARY(MAX) = NULL,

    @PPNombre VARCHAR(255) = NULL,
    @PPTamanioBytes BIGINT = NULL,
    @PermisoPublicidad VARBINARY(MAX) = NULL,

    @CSNombre VARCHAR(255) = NULL,
    @CSTamanioBytes BIGINT = NULL,
    @CarnetSeguro VARBINARY(MAX) = NULL
)
AS
BEGIN
    INSERT INTO Alumno
    (
        Id_TipoDocumento,
        Id_Apoderado,
        Nombres,
        ApPaterno,
        ApMaterno,
        Documento,
        FechaNacimiento,
        Sexo,
        FoNombre,
        FoTamanioBytes,
        Fotos,
        CDNombre,
        CDTamanioBytes,
        CopiaDni,
        PPNombre,
        PPTamanioBytes,
        PermisoPublicidad,
        CSNombre,
        CSTamanioBytes,
        CarnetSeguro
    )
    VALUES
    (
        @Id_TipoDocumento,
        @Id_Apoderado,
        @Nombres,
        @ApPaterno,
        @ApMaterno,
        @Documento,
        @FechaNacimiento,
