CREATE   PROC [dbo].[insertar_grupoServicio]
(
    @Id_Salon             INT,
    @Id_Profesor          INT,
    @Id_ServicioAdicional INT,
    @Periodo              INT   -- si ya lo dejaste INT; si no, usa SMALLINT
)
AS
BEGIN
    SET NOCOUNT ON;
    SET XACT_ABORT ON;

    BEGIN TRY

        -- 1) Validar duplicado
        IF EXISTS (
            SELECT 1
            FROM GrupoServicio
            WHERE Id_Salon = @Id_Salon
              AND Id_Profesor = @Id_Profesor
              AND Id_ServicioAdicional = @Id_ServicioAdicional
              AND Periodo = @Periodo
        )
        BEGIN
            SELECT 'Ya existe un GrupoServicio con el mismo Saln, Profesor, Servicio y Periodo.' AS Mensaje;
            RETURN;
        END

        -- 2) Insert
        INSERT INTO GrupoServicio (Id_Salon, Id_Profesor, Id_ServicioAdicional, Periodo)
        VALUES (@Id_Salon, @Id_Profesor, @Id_ServicioAdicional, @Periodo);

        SELECT 'OK' AS Mensaje;

    END TRY
    BEGIN CATCH
        SELECT ERROR_MESSAGE() AS Mensaje;
    END CATCH
END;
GO
