/****** Object:  StoredProcedure [dbo].[insertar_servicioAlumno]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[insertar_servicioAlumno]
(
    @Id_GrupoServicio INT,
    @Id_Alumno        INT,
    @FechaInicio      DATE,
    @FechaFinal       DATE = NULL,
    @FechaPago        DATE = NULL,
    @HoraInicio       TIME(0) = NULL,
    @HoraFinal        TIME(0) = NULL,
    @Monto            DECIMAL(10,2),

    @IdGenerado       INT OUTPUT,
    @Mensaje          VARCHAR(200) OUTPUT
)
AS
BEGIN
    SET NOCOUNT ON;
    SET XACT_ABORT ON;

    BEGIN TRY
        -- Validaciones bsicas
        IF @Monto < 0
        BEGIN
            SET @IdGenerado = 0;
            SET @Mensaje = 'El monto no puede ser negativo.';
            RETURN;
        END

        IF @FechaFinal IS NOT NULL AND @FechaFinal < @FechaInicio
        BEGIN
            SET @IdGenerado = 0;
            SET @Mensaje = 'FechaFinal no puede ser menor que FechaInicio.';
            RETURN;
        END

        IF @HoraInicio IS NOT NULL AND @HoraFinal IS NOT NULL AND @HoraFinal <= @HoraInicio
        BEGIN
            SET @IdGenerado = 0;
            SET @Mensaje = 'HoraFinal debe ser mayor que HoraInicio.';
            RETURN;
        END

        -- Evitar duplicado exacto (opcional, depende tu negocio)
        IF EXISTS (
            SELECT 1
            FROM ServicioAlumno
            WHERE Id_GrupoServicio = @Id_GrupoServicio
              AND Id_Alumno = @Id_Alumno
              AND FechaInicio = @FechaInicio
        )
        BEGIN
            SET @IdGenerado = 0;
            SET @Mensaje = 'El alumno ya tiene registrado este servicio en esa fecha de inicio.';
            RETURN;
        END

        INSERT INTO ServicioAlumno
        (
            Id_GrupoServicio, Id_Alumno,
            FechaInicio, FechaFinal, FechaPago,
            HoraInicio, HoraFinal, Monto
        )
        VALUES
        (
            @Id_GrupoServicio, @Id_Alumno,
            @FechaInicio, @FechaFinal, @FechaPago,
            @HoraInicio, @HoraFinal, @Monto
        );

        SET @IdGenerado = SCOPE_IDENTITY();
        SET @Mensaje = 'OK';
    END TRY
    BEGIN CATCH
        SET @IdGenerado = 0;
        SET @Mensaje = ERROR_MESSAGE();
    END CATCH
END;
GO
