create   proc [dbo].[listar_alumnos]
as
select  a.*,
		COALESCE(u.Nombres,'') + ' ' +
		COALESCE(u.ApPaterno,'') + ' ' +
		COALESCE(u.ApMaterno,'') AS NombreCompleto,
		td.Nombre as NombreTipoDocumento,
		CASE 
			WHEN a.FoTamanioBytes > 0 THEN 'Subido'
			ELSE 'Sin Subir' 
		END AS EstadoFotos,
		CASE 
			WHEN a.CDTamanioBytes > 0 THEN 'Subido'
			ELSE 'Sin Subir' 
		END AS EstadoCopiaDni,
		CASE 
			WHEN a.PPTamanioBytes > 0 THEN 'Subido'
			ELSE 'Sin Subir' 
		END AS EstadoPermisoPublicidad,
		CASE 
			WHEN a.CSTamanioBytes > 0 THEN 'Subido'
			ELSE 'Sin Subir' 
		END AS EstadoCarnetSeguro
from Alumno as a 
inner join TipoDocumento as td on a.Id_TipoDocumento=td.Id_TipoDocumento
inner join Usuario as u on a.Id_Apoderado=u.Id
GO
