CREATE PROC [dbo].[listar_grupoServicio]
AS
BEGIN
    SELECT 
        gs.Id_GrupoServicio,
        gs.Id_Salon,
        s.Nombre AS NombreSalon,

        gs.Id_Profesor,
        (u.Nombres + ' ' + u.ApPaterno + ' ' + u.ApMaterno) AS NombreProfesor,

        gs.Id_ServicioAdicional,
        sa.Nombre AS NombreServicio,

        gs.Periodo
    FROM GrupoServicio gs
    INNER JOIN Salon s 
        ON s.Id_Salon = gs.Id_Salon
    INNER JOIN Profesor p
        ON p.Id_Profesor = gs.Id_Profesor
    INNER JOIN Usuario u
        ON u.Id = p.Id_Profesor
    INNER JOIN ServicioAdicional sa
        ON sa.Id_ServicioAdicional = gs.Id_ServicioAdicional
    ORDER BY gs.Id_GrupoServicio DESC;
END;
