CREATE   PROC [dbo].[Matricula_Actualizar]
    @Id_Matricula     INT,
    @Id_Alumno        INT,
    @Id_GrupoAnual    INT,
    @Id_Tarifario     INT,
    @Codigo           VARCHAR(20),
    @FechaMatricula   DATE = NULL,
    @SubTotal         DECIMAL(10,2) = NULL,
    @DescuentoTotal   DECIMAL(10,2) = NULL,
    @Total            DECIMAL(10,2) = NULL,
    @Estado           CHAR(1),
    @Observacion      VARCHAR(250) = NULL
AS
BEGIN
    SET NOCOUNT ON;

    UPDATE Matricula
    SET
        Id_Alumno      = @Id_Alumno,
        Id_GrupoAnual  = @Id_GrupoAnual,
        Id_Tarifario   = @Id_Tarifario,
        Codigo         = @Codigo,
        FechaMatricula = @FechaMatricula,
        SubTotal       = @SubTotal,
        DescuentoTotal = @DescuentoTotal,
        Total          = @Total,
        Estado         = @Estado,
        Observacion    = @Observacion
    WHERE Id_Matricula = @Id_Matricula;
END;
GO
/****** Object:  StoredProcedure [dbo].[Matricula_CambiarEstado]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE   PROC [dbo].[Matricula_CambiarEstado]
    @Id_Matricula INT,
    @Estado       CHAR(1)   -- 'A' = Activo, 'I' = Inactivo
AS
BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        BEGIN TRAN;

        -- 1. Cambiar estado de la cabecera
        UPDATE Matricula
        SET Estado = @Estado
        WHERE Id_Matricula = @Id_Matricula;

        -- 2. Activar / desactivar cuotas detalladas
        UPDATE MatriculaDetalle
        SET Activo = CASE WHEN @Estado = 'A' THEN 1 ELSE 0 END
        WHERE Id_Matricula = @Id_Matricula;

        COMMIT TRAN;
    END TRY
    BEGIN CATCH
        IF @@TRANCOUNT > 0 ROLLBACK TRAN;
        ;THROW;
    END CATCH
END;
GO
/****** Object:  StoredProcedure [dbo].[Matricula_GenerarCuotas]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[Matricula_GenerarCuotas]
    @Id_Matricula INT
AS
BEGIN
    SET NOCOUNT ON;

    DECLARE @Id_Tarifario INT;

    -- 1. Tomamos el tarifario de la matrcula recin creada
    SELECT @Id_Tarifario = Id_Tarifario
    FROM Matricula
    WHERE Id_Matricula = @Id_Matricula;

    -- 2. Insertamos las cuotas en MatriculaDetalle,
    --    copiando desde la tabla plantilla Cuota
    INSERT INTO MatriculaDetalle
    (
        Id_Matricula,
        NroCuota,
        NombreCuota,
        FechaVencimiento,
        Cantidad,
        Monto,
        Descuento,
        Adicional,
        TotalLinea,
        FechaPago,
        EstadoPago,
        Observacion,
        Activo   -- si tienes este campo tipo BIT
    )
    SELECT
        @Id_Matricula                     AS Id_Matricula,
        c.NroCuota,
        c.NombreCuota,
        c.FechaPagoSugerido,
        1                                  AS Cantidad,
        c.Monto,
        0                                  AS Descuento,
        0                                  AS Adicional,
        (1 * c.Monto)                      AS TotalLinea,
        NULL                               AS FechaPago,
        'P'                                AS EstadoPago,  -- P = Pendiente
        NULL                               AS Observacion,
        1                                  AS Activo
    FROM Cuota c
    WHERE c.Id_Tarifario = @Id_Tarifario
    ORDER BY c.NroCuota;
END;
GO
/****** Object:  StoredProcedure [dbo].[Matricula_Insertar]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[Matricula_Insertar]
    @Id_Matricula     INT OUTPUT,
    @Id_Alumno        INT,
    @Id_GrupoAnual    INT,
    @Id_Tarifario     INT,
    @Codigo           VARCHAR(20),
    @FechaMatricula   DATE = NULL,
    @SubTotal         DECIMAL(10,2) = NULL,
    @DescuentoTotal   DECIMAL(10,2) = NULL,
    @Total            DECIMAL(10,2) = NULL,
    @Estado           CHAR(1) = 'A',
    @Observacion      VARCHAR(250) = NULL
AS
BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        BEGIN TRAN;

        INSERT INTO Matricula
        (
            Id_Alumno,
            Id_GrupoAnual,
            Id_Tarifario,
            Codigo,
            FechaMatricula,
            SubTotal,
            DescuentoTotal,
            Total,
            Estado,
            Observacion
        )
        VALUES
        (
            @Id_Alumno,
            @Id_GrupoAnual,
            @Id_Tarifario,
            @Codigo,
            @FechaMatricula,
            @SubTotal,
            @DescuentoTotal,
            @Total,
            @Estado,
            @Observacion
        );

        SET @Id_Matricula = SCOPE_IDENTITY();
        exec Matricula_GenerarCuotas @Id_Matricula;
        EXEC Nido_Matricula_RecalcularTotales @Id_Matricula;
        COMMIT TRAN;
    END TRY
    BEGIN CATCH
        IF @@TRANCOUNT > 0 ROLLBACK TRAN;

        ;THROW;   -- re-lanza el error al cliente
    END CATCH
END;
GO
