CREATE   PROC [dbo].[Matricula_Listar]
    @Id_Matricula  INT     = NULL,
    @Id_Alumno     INT     = NULL,
    @Id_GrupoAnual INT     = NULL,
    @Estado        CHAR(1) = NULL
AS
BEGIN
    SET NOCOUNT ON;

    SELECT 
        m.Id_Matricula,
        m.Id_Alumno,
        m.Id_GrupoAnual,
        m.Id_Tarifario,
        m.Codigo,
        m.FechaMatricula,
        m.SubTotal,
        m.DescuentoTotal,
        m.Total,
        m.Estado,
        m.Observacion
    FROM Matricula m
    WHERE (@Id_Matricula  IS NULL OR m.Id_Matricula  = @Id_Matricula)
      AND (@Id_Alumno     IS NULL OR m.Id_Alumno     = @Id_Alumno)
      AND (@Id_GrupoAnual IS NULL OR m.Id_GrupoAnual = @Id_GrupoAnual)
      AND (@Estado        IS NULL OR m.Estado        = @Estado)
    ORDER BY m.Id_Matricula DESC;
END;
