CREATE   PROC [dbo].[MatriculaDetalle_Actualizar]
    @Id_MatriculaDetalle INT,
    -- @Id_Cuota        INT = NULL,  -- ? YA NO
    @NroCuota            INT = NULL,
    @NombreCuota         VARCHAR(100) = NULL,
    @FechaVencimiento    DATE = NULL,
    @Cantidad            INT,
    @Monto               DECIMAL(10,2),
    @Descuento           DECIMAL(10,2) = 0,
    @Adicional           DECIMAL(10,2) = 0,
    @FechaPago           DATE = NULL,
    @EstadoPago          CHAR(1),
    @Observacion         VARCHAR(200) = NULL
AS
BEGIN
    SET NOCOUNT ON;

    DECLARE 
        @TotalLinea    DECIMAL(10,2),
        @Id_Matricula  INT;

    -- 1) Obtener el Id_Matricula a partir del detalle
    SELECT @Id_Matricula = Id_Matricula
    FROM dbo.MatriculaDetalle
    WHERE Id_MatriculaDetalle = @Id_MatriculaDetalle;

    -- (Opcional: si no existe el detalle, salir)
    IF @Id_Matricula IS NULL
        RETURN;

    -- 2) Calcular el total de la lnea
    SET @TotalLinea = (@Cantidad * @Monto) - @Descuento + @Adicional;

    -- 3) Actualizar el detalle
    UPDATE dbo.MatriculaDetalle
    SET
        -- Id_Cuota         = @Id_Cuota,          -- ? NO lo tocamos
        NroCuota         = @NroCuota,
        NombreCuota      = @NombreCuota,
        FechaVencimiento = @FechaVencimiento,
        Cantidad         = @Cantidad,
        Monto            = @Monto,
        Descuento        = @Descuento,
        Adicional        = @Adicional,
        TotalLinea       = @TotalLinea,
        FechaPago        = @FechaPago,
        EstadoPago       = @EstadoPago,
        Observacion      = @Observacion
    WHERE Id_MatriculaDetalle = @Id_MatriculaDetalle;

    -- 4) Solo recalcular si realmente se actualiz algo
    IF @@ROWCOUNT > 0
    BEGIN
        EXEC dbo.Nido_Matricula_RecalcularTotales @Id_Matricula;
    END
END;
GO
