/****** Object:  StoredProcedure [dbo].[modificar_alumnos]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[modificar_alumnos]
(
    @Id_Alumno INT,
    @Id_TipoDocumento INT,
    @Id_Apoderado INT,
    @Nombres VARCHAR(50) = NULL,
    @ApPaterno VARCHAR(50) = NULL,
    @ApMaterno VARCHAR(50) = NULL,
    @Documento VARCHAR(20),
    @FechaNacimiento DATE = NULL,
    @Sexo CHAR(1) = NULL,
	@Activo bit,

    @FoNombre VARCHAR(255) = NULL,
    @FoTamanioBytes BIGINT = NULL,
    @Fotos VARBINARY(MAX) = NULL,

    @CDNombre VARCHAR(255) = NULL,
    @CDTamanioBytes BIGINT = NULL,
    @CopiaDni VARBINARY(MAX) = NULL,

    @PPNombre VARCHAR(255) = NULL,
    @PPTamanioBytes BIGINT = NULL,
    @PermisoPublicidad VARBINARY(MAX) = NULL,

    @CSNombre VARCHAR(255) = NULL,
    @CSTamanioBytes BIGINT = NULL,
    @CarnetSeguro VARBINARY(MAX) = NULL
)
AS
BEGIN
    SET NOCOUNT ON;

    -------------------------------------------------------------------
    -- 1. ACTUALIZAR DATOS PRINCIPALES (SIN ARCHIVOS)
    -------------------------------------------------------------------
    UPDATE Alumno
    SET 
        Id_Apoderado = @Id_Apoderado,
		Id_TipoDocumento = @Id_TipoDocumento,
        Nombres = @Nombres,
        ApPaterno = @ApPaterno,
        ApMaterno = @ApMaterno,
        Documento = @Documento,
        FechaNacimiento = @FechaNacimiento,
        Sexo = @Sexo,
		Activo = @Activo
    WHERE Id_Alumno = @Id_Alumno;


    -------------------------------------------------------------------
    -- 2. ACTUALIZACIONES OPCIONALES DE ARCHIVOS (SOLO SI SE ENVIAN)
    -------------------------------------------------------------------

    -- FOTO
    IF (@Fotos IS NOT NULL AND @FoTamanioBytes IS NOT NULL AND @FoNombre IS NOT NULL)
    BEGIN
        UPDATE Alumno
        SET 
            Fotos = @Fotos,
            FoTamanioBytes = @FoTamanioBytes,
            FoNombre = @FoNombre
        WHERE Id_Alumno = @Id_Alumno;
    END

    -- COPIA DNI
    IF (@CopiaDni IS NOT NULL AND @CDTamanioBytes IS NOT NULL AND @CDNombre IS NOT NULL)
    BEGIN
        UPDATE Alumno
        SET 
            CopiaDni = @CopiaDni,
            CDTamanioBytes = @CDTamanioBytes,
            CDNombre = @CDNombre
        WHERE Id_Alumno = @Id_Alumno;
    END

    -- PERMISO DE PUBLICIDAD
    IF (@PermisoPublicidad IS NOT NULL AND @PPTamanioBytes IS NOT NULL AND @PPNombre IS NOT NULL)
    BEGIN
        UPDATE Alumno
        SET 
            PermisoPublicidad = @PermisoPublicidad,
            PPTamanioBytes = @PPTamanioBytes,
            PPNombre = @PPNombre
        WHERE Id_Alumno = @Id_Alumno;
    END

    -- CARNET SEGRO
    IF (@CarnetSeguro IS NOT NULL AND @CSTamanioBytes IS NOT NULL AND @CSNombre IS NOT NULL)
    BEGIN
        UPDATE Alumno
        SET 
            CarnetSeguro = @CarnetSeguro,
            CSTamanioBytes = @CSTamanioBytes,
            CSNombre = @CSNombre
        WHERE Id_Alumno = @Id_Alumno;
    END

END
GO
