CREATE   PROCEDURE [dbo].[modificar_profesores]
(
    @Id_Profesor INT,
    @FechaIngreso DATE = NULL,

    @TPTamanioBytes BIGINT = NULL,
    @TPNombre VARCHAR(255) = NULL,
    @TituloProfesional VARBINARY(MAX) = NULL,

    @CvTamanioBytes BIGINT = NULL,
    @CvNombre VARCHAR(255) = NULL,
    @Cv VARBINARY(MAX) = NULL,

    @EPSTamanioBytes BIGINT = NULL,
    @EPSNombre VARCHAR(255) = NULL,
    @EvaluacionPsicologica VARBINARY(MAX) = NULL,

    @FoTamanioBytes BIGINT = NULL,
    @FoNombre VARCHAR(255) = NULL,
    @Fotos VARBINARY(MAX) = NULL,

    @VDTamanioBytes BIGINT = NULL,
    @VDNombre VARCHAR(255) = NULL,
    @VerificacionDomiciliaria VARBINARY(MAX) = NULL
)
AS
BEGIN

    UPDATE Profesor
    SET 
        FechaIngreso = @FechaIngreso
    WHERE Id_Profesor = @Id_Profesor;

    -- Si se envi archivo, actualizamos archivo
    IF (@TituloProfesional IS NOT NULL AND @TPTamanioBytes IS NOT NULL AND @TPNombre IS NOT NULL)
    BEGIN
        UPDATE Profesor
        SET 
            TituloProfesional = @TituloProfesional,
            TPTamanioBytes = @TPTamanioBytes,
            TPNombre = @TPNombre
        WHERE Id_Profesor = @Id_Profesor;
    END

	-- Si se envi archivo, actualizamos archivo
    IF (@Cv IS NOT NULL AND @CvTamanioBytes IS NOT NULL AND @CvNombre IS NOT NULL)
    BEGIN
        UPDATE Profesor
        SET 
            Cv = @Cv,
            CvTamanioBytes = @CvTamanioBytes,
            CvNombre = @CvNombre
        WHERE Id_Profesor = @Id_Profesor;
    END
    -- Si se envi archivo, actualizamos archivo
    IF (@EvaluacionPsicologica IS NOT NULL AND @EPSTamanioBytes IS NOT NULL AND @EPSNombre IS NOT NULL)
    BEGIN
        UPDATE Profesor
        SET 
            EvaluacionPsicologica = @EvaluacionPsicologica,
            EPSTamanioBytes = @EPSTamanioBytes,
            EPSNombre = @EPSNombre
        WHERE Id_Profesor = @Id_Profesor;
    END

	-- FOTO
    IF (@Fotos IS NOT NULL AND @FoTamanioBytes IS NOT NULL AND @FoNombre IS NOT NULL)
    BEGIN
        UPDATE Profesor
        SET 
            Fotos = @Fotos,
            FoTamanioBytes = @FoTamanioBytes,
            FoNombre = @FoNombre
        WHERE Id_Profesor = @Id_Profesor;
    END

	-- Si se envi archivo, actualizamos archivo
    IF (@VerificacionDomiciliaria IS NOT NULL AND @VDTamanioBytes IS NOT NULL AND @VDNombre IS NOT NULL)
    BEGIN
        UPDATE Profesor
        SET 
            VerificacionDomiciliaria = @VerificacionDomiciliaria,
            VDTamanioBytes = @VDTamanioBytes,
            VDNombre = @VDNombre
        WHERE Id_Profesor = @Id_Profesor;
    END
END;
