CREATE   PROC [dbo].[mov_listar_comunicados_apoderado]
    @Id_Usuario INT
AS
BEGIN
    SET NOCOUNT ON;
    SELECT
        C.Id_Comunicado,
        ISNULL(C.Nombre, '')        AS Titulo,
        ISNULL(C.Descripcion, '')   AS Descripcion,
        C.FechaCreacion,
        C.FechaFinal,
        CAST(CASE WHEN CV.Id_Usuario IS NULL THEN 0 ELSE 1 END AS BIT) AS Visto,
        CASE 
            WHEN CV.Id_Usuario IS NULL THEN 'NO VISTO'
            ELSE 'VISTO'
        END AS EstadoTexto
    FROM Comunicado C
    LEFT JOIN ComunicadoVisto CV
        ON CV.Id_Comunicado = C.Id_Comunicado
       AND CV.Id_Usuario = @Id_Usuario
    WHERE C.Id_Rol = 3;
END
GO
