CREATE   PROC [dbo].[mov_login_apoderado]
    @UsuarioODocumento VARCHAR(100),
    @Clave             VARCHAR(200)
AS
BEGIN
    SET NOCOUNT ON;

    SELECT TOP 1
        U.Id AS Id_Usuario,
        U.NombreUsuario,
        U.Documento,
        (U.Nombres + ' ' + U.ApPaterno + ' ' + U.ApMaterno) AS NombreCompleto,
