/****** Object:  StoredProcedure [dbo].[mov_resumen_cuotas_por_matricula]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[mov_resumen_cuotas_por_matricula]
    @Id_Matricula INT
AS
BEGIN
    SET NOCOUNT ON;

    SELECT
        -- Total SOLO de cuotas activas
        SUM(CASE 
                WHEN Activo = 1 
                THEN TotalLinea 
                ELSE 0 
            END) AS Total,

        -- Pagado: solo cuotas activas y cobradas
        SUM(CASE 
                WHEN Activo = 1 
                 AND EstadoPago = 'C'
                THEN TotalLinea 
                ELSE 0 
            END) AS Pagado,

        -- Pendiente: solo cuotas activas y pendientes
        SUM(CASE 
                WHEN Activo = 1 
                 AND EstadoPago = 'P'
                THEN TotalLinea 
                ELSE 0 
            END) AS Pendiente
    FROM MatriculaDetalle
    WHERE Id_Matricula = @Id_Matricula;
END
GO
