/****** Object:  StoredProcedure [dbo].[Nido_Matricula_Listar]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
----------------------------------PROCEDIMIENTOS PARA MATRICULA

CREATE   PROC [dbo].[Nido_Matricula_Listar]
    @Estado CHAR(1) = NULL   -- Opcional
AS
BEGIN
    SET NOCOUNT ON;

    SELECT 
        m.Id_Matricula,
        m.Codigo,
        m.Id_Alumno,
        AlumnoNombre = a.Nombres + ' ' + a.ApPaterno + ' ' + a.ApMaterno,
        m.Id_GrupoAnual,
        GrupoNombre = CONCAT(n.Nombre, ' - ', g.Periodo),
        m.Id_Tarifario,
        NombreTarifario = t.Nombre,
        m.Total,
        m.Estado
    FROM Matricula m
    JOIN Alumno a ON a.Id_Alumno = m.Id_Alumno
    JOIN GrupoAnual g ON g.Id_GrupoAnual = m.Id_GrupoAnual
    JOIN Nivel n ON n.Id_Nivel = g.Id_Nivel
    JOIN Tarifario t ON t.Id_Tarifario = m.Id_Tarifario
    WHERE (@Estado IS NULL OR m.Estado = @Estado)
    ORDER BY m.Id_Matricula DESC;
END;
