/****** Object:  StoredProcedure [dbo].[Nido_Matricula_RecalcularTotales]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[Nido_Matricula_RecalcularTotales]
    @Id_Matricula INT
AS
BEGIN
    SET NOCOUNT ON;

    DECLARE 
        @SubTotal       DECIMAL(10,2),
        @DescuentoTotal DECIMAL(10,2),
        @Total          DECIMAL(10,2);

    SELECT
        @SubTotal       = ISNULL(SUM(md.Cantidad * md.Monto), 0),
        @DescuentoTotal = ISNULL(SUM(md.Descuento), 0),
        @Total          = ISNULL(SUM(md.TotalLinea), 0)   -- usa la columna TotalLinea
    FROM MatriculaDetalle md
    WHERE md.Id_Matricula = @Id_Matricula
      AND md.Activo = 1;     -- solo cuotas vigentes (ajusta si usas otro campo)

    UPDATE Matricula
    SET SubTotal       = @SubTotal,
        DescuentoTotal = @DescuentoTotal,   -- o DescTotal, segn tu tabla
        Total          = @Total
    WHERE Id_Matricula = @Id_Matricula;
END;
GO
/****** Object:  StoredProcedure [dbo].[Nido_Matricula_Registrar]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROC [dbo].[Nido_Matricula_Registrar]
(
    @Id_Alumno     INT,
    @Id_GrupoAnual INT,
    @Id_Tarifario  INT,
    @Codigo        VARCHAR(20)
)
AS
BEGIN
    SET NOCOUNT ON;
    SET XACT_ABORT ON;

    DECLARE @FechaMatricula DATE = CAST(GETDATE() AS DATE);
    DECLARE @Id_Matricula INT;

    BEGIN TRAN;

    -- 1) Insertar CABECERA
    INSERT INTO Matricula
    (Id_Alumno, Id_GrupoAnual, Id_Tarifario, Codigo, FechaMatricula,
     SubTotal, DescuentoTotal, Total, Estado, Observacion)
    VALUES
    (@Id_Alumno, @Id_GrupoAnual, @Id_Tarifario, @Codigo, @FechaMatricula,
     0, 0, 0, 'A', NULL);

    SET @Id_Matricula = SCOPE_IDENTITY();

    -- 2) Generar DETALLE copiando de la plantilla CUOTA
    INSERT INTO MatriculaDetalle
    (
        Id_Matricula,
        Id_Cuota,
        NroCuota,
        NombreCuota,
        FechaVencimiento,
        Cantidad,
        Monto,
        Descuento,
        Adicional,
        TotalLinea,
        FechaPago,
        EstadoPago,
        Observacion
    )
    SELECT
        @Id_Matricula,
        c.Id_Cuota,
        c.NroCuota,
        c.NombreCuota,
        c.FechaPagoSugerido,
        1,
        c.Monto,
        c.Descuento,
        c.Adicional,
        (1 * c.Monto) - c.Descuento + c.Adicional,
        NULL,
        'P',
        NULL
    FROM Cuota c
    WHERE c.Id_Tarifario = @Id_Tarifario;

    -- 3) Actualizar TOTALES en Matricula (CORREGIDO)
    UPDATE m
    SET 
        m.SubTotal       = t.SubTotal,
        m.DescuentoTotal = t.DescuentoTotal,
        m.Total          = t.Total
    FROM Matricula m
    JOIN (
        SELECT 
            Id_Matricula,
            SUM(Monto)      AS SubTotal,
            SUM(Descuento)  AS DescuentoTotal,
            SUM(TotalLinea) AS Total
        FROM MatriculaDetalle
        WHERE Id_Matricula = @Id_Matricula
        GROUP BY Id_Matricula
    ) t
        ON m.Id_Matricula = t.Id_Matricula;

    COMMIT TRAN;

    -- Devolver Id de la nueva matrcula
    SELECT @Id_Matricula AS Id_Matricula;
END;
