CREATE PROCEDURE [dbo].[sp_ListarAlumnosPorGrupoServicio]
    @Id_GrupoServicio INT
AS
BEGIN
    SET NOCOUNT ON;
    
    SELECT DISTINCT
        a.Id_Alumno,
        a.Nombres,
        a.ApPaterno,
        a.ApMaterno,
        a.Documento,
        a.FechaNacimiento,
