CREATE PROCEDURE [dbo].[sp_ListarCuotasPorAlumnoPeriodoActual]
    @Id_Alumno INT
AS
BEGIN
    SET NOCOUNT ON;
    
    -- Listar todas las cuotas del alumno de todos los periodos
    SELECT 
        md.Id_MatriculaDetalle,
        md.Id_Matricula,
        md.Id_Cuota,
        md.NroCuota,
        md.NombreCuota,
        md.FechaVencimiento,
        md.Cantidad,
        md.Monto,
        md.Descuento,
        md.Adicional,
        md.TotalLinea,
        md.FechaPago,
        md.EstadoPago,
        md.Observacion,
        ga.Periodo
    FROM MatriculaDetalle md
    INNER JOIN Matricula m ON md.Id_Matricula = m.Id_Matricula
    INNER JOIN GrupoAnual ga ON m.Id_GrupoAnual = ga.Id_GrupoAnual
    WHERE m.Id_Alumno = @Id_Alumno
        AND m.Estado = 'A' -- Solo matrculas activas
    ORDER BY ga.Periodo DESC, md.NroCuota, md.FechaVencimiento
END
GO
/****** Object:  StoredProcedure [dbo].[sp_ListarGruposPorDocente]    Script Date: 14/12/2025 23:26:38 ******/
