create PROCEDURE [dbo].[sp_ListarGruposPorDocente]
    @IdUsuario INT
AS
BEGIN
    SET NOCOUNT ON;
    
    SELECT 
        ga.Id_GrupoAnual,
        n.Nombre AS Nivel,
        s.Nombre AS Salon,
        s.Aforo,
        ga.Periodo,
        COUNT(DISTINCT m.Id_Alumno) AS TotalAlumnos
    FROM dbo.GrupoAnual ga
    INNER JOIN dbo.Salon s ON ga.Id_Salon = s.Id_Salon
    INNER JOIN dbo.Nivel n ON ga.Id_Nivel = n.Id_Nivel
    LEFT JOIN dbo.Matricula m ON ga.Id_GrupoAnual = m.Id_GrupoAnual
    WHERE ga.Id_Profesor = @IdUsuario
    GROUP BY 
        ga.Id_GrupoAnual,
        n.Nombre,
        s.Nombre,
        s.Aforo,
        ga.Periodo
    ORDER BY ga.Periodo DESC, n.Nombre
END
GO
/****** Object:  StoredProcedure [dbo].[sp_ListarOfertasGrupoServicio]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
