/****** Object:  StoredProcedure [dbo].[ValidarUsuario]    Script Date: 14/12/2025 23:26:38 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[ValidarUsuario]
(
    @NombreUsuario VARCHAR(50),
    @Clave VARCHAR(256)
)
AS
BEGIN
    SET NOCOUNT ON;

    DECLARE @Intentos TINYINT,
            @Bloqueado BIT,
            @Activo BIT,
            @ClaveDB VARCHAR(256),
            @IdUsuario INT;

    -- Obtener datos del usuario
    SELECT 
        @Intentos = Intentos,
        @Bloqueado = Bloqueado,
        @Activo = Activo,
        @ClaveDB = Clave,
        @IdUsuario = Id
    FROM Usuario
    WHERE NombreUsuario = @NombreUsuario;

    -- Usuario no existe
    IF @IdUsuario IS NULL
    BEGIN
        SELECT 
            CAST(0 AS BIT) AS Exito, 
            'Usuario no encontrado y/o Contrasea incorrecta' AS Mensaje,
            NULL AS Id_Usuario, NULL AS Id_Rol, NULL AS Id_Permiso;
        RETURN;
    END

    --  NUEVA VALIDACIN: usuario inactivo
    IF @Activo = 0
    BEGIN
        SELECT 
            CAST(0 AS BIT) AS Exito,
            'El usuario se encuentra inactivo. Comunquese con el administrador.' AS Mensaje,
            @IdUsuario AS Id_Usuario, NULL AS Id_Rol, NULL AS Id_Permiso;
        RETURN;
    END

    -- Verificar bloqueo
    IF @Bloqueado = 1
    BEGIN
        SELECT 
            CAST(0 AS BIT) AS Exito, 
            'Usuario bloqueado' AS Mensaje,
            @IdUsuario AS Id_Usuario, NULL AS Id_Rol, NULL AS Id_Permiso;
        RETURN;
    END

    -- Validar contrasea
    IF (@Clave <> @ClaveDB OR @ClaveDB IS NULL)
    BEGIN
        IF (@Intentos >= 3)
        BEGIN
            UPDATE Usuario 
            SET Intentos = Intentos + 1,
                Bloqueado = 1,
                FechaBloqueo = GETDATE(),
                UltimoIntento = GETDATE()
            WHERE Id = @IdUsuario;

            SELECT 
                CAST(0 AS BIT) AS Exito, 
                'Cuenta temporalmente bloqueada por mltiples intentos fallidos.' AS Mensaje,
                @IdUsuario AS Id_Usuario, NULL AS Id_Rol, NULL AS Id_Permiso;
        END
        ELSE
        BEGIN
            UPDATE Usuario 
            SET Intentos = Intentos + 1,
                UltimoIntento = GETDATE()
            WHERE Id = @IdUsuario;

            SELECT 
                CAST(0 AS BIT) AS Exito, 
                'Usuario no encontrado y/o Contrasea incorrecta' AS Mensaje,
                @IdUsuario AS Id_Usuario, NULL AS Id_Rol, NULL AS Id_Permiso;
        END
        RETURN;
    END

    -- Clave correcta
    UPDATE Usuario 
    SET Intentos = 0,
        UltimoLoginExitoso = GETDATE(),
        UltimoIntento = GETDATE()
    WHERE Id = @IdUsuario;

    -- Retornar roles y permisos
    SELECT DISTINCT 
        CAST(1 AS BIT) AS Exito,
        'Bienvenido' AS Mensaje,
        u.Id AS Id_Usuario,
        ur.Id_Rol,
        COALESCE(up.Id_Permiso, rp.Id_Permiso) AS Id_Permiso
    FROM Usuario u
    LEFT JOIN UsuarioRol ur ON u.Id = ur.Id_Usuario
    LEFT JOIN RolPermiso rp ON ur.Id_Rol = rp.Id_Rol
    LEFT JOIN UsuarioPermiso up ON u.Id = up.Id_Usuario
    WHERE u.Id = @IdUsuario;
END
GO
